script: |
  super -f text -I q5263.spq | sort > q5263.out

inputs:
  - name: q5263.spq
    data: |
      SELECT DISTINCT + col2 * - - col2 + + 58 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT + - col2 + + ( col1 ) + - - 99 = col2;
  - name: tab2

outputs:
  - name: q5263.out
    data: |
      1658
      3422
      587
